Seguía el curso de graphql de Alberto Palomar en Udemy y me encontré con este código que marcaba error:


<pre><code>
const express = require('express')
const graphqlHTTP = require('express-graphql')
const schema = require('./schema/schema')
const mongoose = require('mongoose');
const auth = require('./utils/auth')   
</code></pre>

Y encontré la respuesta en este <a href="https://stackoverflow.com/questions/62760975/graphqlhttp-is-not-a-function">post</a> de StackOverflow:

<pre><code>
const { graphqlHTTP } = require('express-graphql');
</code></pre>

Que es el equivalente a:

<pre><code>
const graphqlHTTP = require('express-graphql').graphqlHTTP;
</code></pre>
